import React from 'react';
import {Button} from 'react-bootstrap'
import logo from './logo.svg';
import './App.css';
//import '@fontawesome/fontawesome-free/css/all.css'

class Header extends React.Component{
  render(){
    return(

        <div>
          <h1>Northwest Labs</h1>

          <h3>Where all you chemical testing dreams come true!</h3>
        </div>
    )
  }
}

class Footer extends React.Component{
  render(){
    var today = new Date();

    return(
      <div>
          <h6> © {today.getFullYear()} Northwest Labs</h6>
      </div>
    )
  }
}

class NavBar extends React.Component{
  render(){
    return(
      <nav className="navbar navbar-expand-lg navbar-light sticky-top bg-success">
        <a class="navbar-brand" href="#"><i class="fas fa-flask"></i></a>
        <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
          <span class="navbar-toggler-icon"></span>
        </button>

        <div class="collapse navbar-collapse" id="navbarSupportedContent">
          <ul class="navbar-nav mr-auto">
            <li class="nav-item active">
              <a class="nav-link" href="#">Home <span class="sr-only">(current)</span></a>
            </li>
            <li class="nav-item">
              <a class="nav-link" href="#">About</a>
            </li>
            <li class="nav-item">
              <a class="nav-link" href="#">Contact</a>
            </li>
            <li class="nav-item dropdown">
              <a class="nav-link dropdown-toggle" href="#" id="navbarDropdown" role="button" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
                Services
              </a>
              <div class="dropdown-menu" aria-labelledby="navbarDropdown">
                <a class="dropdown-item" href="#">Service 1</a>
                <a class="dropdown-item" href="#">Service 2</a>
                <div class="dropdown-divider"></div>
                <a class="dropdown-item" href="#">Premium Service</a>
              </div>
            </li>
          </ul>
        </div>
      </nav>
    )
  }
}

function App() {
  return (
    <div className="App">
      <NavBar/>
      <header className="App-header">
         <i className="fas fa-flask m-3 p-4" style={{
            fontSize: "10rem",
            color: "#blue"
          }}></i></header>
      <Header/>
      <Button variant="success" size="lg">Get Started today!</Button>
      <p>This is some other content that we can put on here</p>
      <Footer/>
    </div>
  );
}

export default App;
